INSERT INTO "API_nodes" ("id","inputs","inputs_comments","outputs","outputs_comments","executed","project_id","node_seq_id") VALUES (1,'','','','<p>This is a preliminary formulation of the problem which must be complete in the future</p>',1,1,1),
 (2,'','','<p><strong>Arundic acid.&nbsp;</strong></p><p>IUPAC: (2R)-2-propyloctanoic acid</p><p>CAS-RN: 185517-21-9</p><p>SMILES:&nbsp;</p><figure class="image image-style-align-left"><img src="data:image/png;base64," alt="CCCCCC[C@@H](CCC)C(O)=O"></figure><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>CCCCCC[C@@H](CCC)C(O)=O</p><p>ChEMBL: &nbsp;CHEMBL3187683</p><p>Other: ONO-2506</p><p>(From DrugBank) Arundic acid is a neuroprotective because of its actions on glia cells. It has inhibitory effects on the synthesis of a calcium-binding protein S100B. Arundic acid is undergoing clinical trials for the treatment of patients with stroke and Alzheimer''s disease.</p><p>(From <a href="https://doi.org/10.1016/j.neuropharm.2005.09.014">10.1016/j.neuropharm.2005.09.014</a>) The protective effect may be, at least in part, caused by the reductions of the levels of reactive nitrogen (RNS) and oxygen species (ROS) against MPTP neurotoxicity. These results suggest that the pharmacological modulation of astrocyte may offer a novel therapeutic strategy for the treatment of Parkinson''s disease.</p><p>An initial search for in vitro data in CHEMBL shows 2 bioactivities for Arundic acid (CHEMBL ID 3187683), none of them likely to be related with toxicological effects of the TC.&nbsp;</p><p>PC data (ChEMBL)</p><ul><li>Mol. Weight: 186.29</li><li>MW. Monoisotopic: 186.162</li><li>ALogP: 3.46</li><li>#Rotatable Bonds: 8</li><li>Polar Surface Area:37.3</li><li>Molecular Species: ACID</li><li>HBA: 1</li><li>HDB: 1</li><li>#Ro5 Violations:0</li><li>HBA (Lipinski): 2</li><li>HBD (Lipinski): 1</li><li>#Ro5 Violations (Lipinski): 0</li><li>ACD Acidic pKa: 4.82</li><li>ACD Basic pKa: --</li><li>#ACD LogP:4.11</li><li>ACD LogD pH7.4:1.55</li><li>Aromatic Rings:0</li><li>Heavy Atoms: 13</li><li>QED Weighted:0.59</li></ul>','<p>TC characterization in progress</p>',1,1,2),
 (3,'','','<p><i>Phase I (CYP450) transformation prediction by BioTransformer suggests the following 7 metabolites</i></p><figure class="table"><table><tbody><tr><td><i>CCC[C@H](CCCCC(C)O)C(O)=O</i></td><td><figure class="image"><img src="data:image/png;base64," alt="CCC[C@H](CCCCC(C)O)C(O)=O"></figure><p>&nbsp;</p></td></tr><tr><td><i>CCCCCC[C@@H](CC(C)O)C(O)=O</i></td><td><figure class="image"><img src="data:image/png;base64," alt="CCCCCC[C@@H](CC(C)O)C(O)=O"></figure><p>&nbsp;</p></td></tr><tr><td><i>CCC[C@H](CCCCCCO)C(O)=O</i></td><td><figure class="image"><img src="data:image/png;base64," alt="CCC[C@H](CCCCCCO)C(O)=O"></figure></td></tr><tr><td><i>CCCCCC[C@@H](CCCO)C(O)=O</i></td><td><figure class="image"><img src="data:image/png;base64," alt="CCCCCC[C@@H](CCCO)C(O)=O"></figure></td></tr><tr><td><i>CCCCCCC(O)(CCC)C(O)=O</i></td><td><figure class="image"><img src="data:image/png;base64," alt="CCCCCCC(O)(CCC)C(O)=O"></figure><p>&nbsp;</p></td></tr><tr><td><i>CCC[C@H](CCCCC=C)C(O)=O</i></td><td><figure class="image"><img src="data:image/png;base64," alt="CCC[C@H](CCCCC=C)C(O)=O"></figure></td></tr><tr><td><i>CCCCCC[C@@H](CC=C)C(O)=O</i></td><td><figure class="image"><img src="data:image/png;base64," alt="CCCCCC[C@@H](CC=C)C(O)=O"></figure><p>&nbsp;</p></td></tr></tbody></table></figure>','<p>Further evaluation of the metabolites is pending</p>',1,1,3),
 (4,'','','<p>A first hypothesis on a mode of action is not possible based on the available in vivo or in vitro data.</p>','<p>None</p>',1,1,4),
 (5,'','','<p>Two compounds found in CHEMBL with &gt; 0.85 similarity (RDKit Morgan Fingerprints, Tanimoto similarity)</p><figure class="table"><table><tbody><tr><td><strong>ChEMBL ID</strong></td><td><strong>SMILES</strong></td><td><strong>structure</strong></td></tr><tr><td>CHEMBL1789216</td><td>CCCCCCC(CCCC)C(=O)O</td><td><figure class="image"><img src="data:image/png;base64," alt="CCCCCCC(CCCC)C(=O)O"></figure><p>&nbsp;</p></td></tr><tr><td>CHEMBL3182660</td><td>CCCCCCCCC(CCCCCC)C(=O)O</td><td><figure class="image"><img src="data:image/png;base64," alt="CCCCCCCCC(CCCCCC)C(=O)O"></figure></td></tr></tbody></table></figure>','<p>Manual selection in progress&nbsp;</p>',1,1,5),
